from typing import List
import sys

class Solution:
    def numberOfCleanRooms(self, room: List[List[int]]) -> int:
        def within_bounds(r, c):
            if 0 <= r < rows and 0 <= c < cols:
                return True
            return False
        def solve(r, c, direction):
            # If space is visited or has an object then stop
            if not within_bounds(r, c) or (r, c, direction) in visited or room[r][c] == 1:
                return 0
            # Set current space as visited
            visited.add((r, c, direction))
            cleaned.add((r, c))
            # Determine the next cell; turn if next space is
            # out-of-bounds or has an object
            if direction == 'right':
                rnew, cnew = r, c + 1
                if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                    direction = 'down'
                    rnew, cnew = r + 1, c
                    if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                        direction = 'left'
                        rnew, cnew = r, c - 1
                        if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                            direction = 'up'
                            rnew, cnew = r - 1, c
                return 1 + solve(rnew, cnew, direction)
            if direction == 'down':
                rnew, cnew = r + 1, c
                if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                    direction = 'left'
                    rnew, cnew = r, c - 1
                    if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                        direction = 'up'
                        rnew, cnew = r - 1, c
                        if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                            direction = 'right'
                            rnew, cnew = r, c + 1
                return 1 + solve(rnew, cnew, direction)
            if direction == 'left':
                rnew, cnew = r, c - 1
                if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                    direction = 'up'
                    rnew, cnew = r - 1, c
                    if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                        direction = 'right'
                        rnew, cnew = r, c + 1
                        if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                            direction = 'down'
                            rnew, cnew = r + 1, c
                return 1 + solve(rnew, cnew, direction)
            if direction == 'up':
                rnew, cnew = r - 1, c
                if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                    direction = 'right'
                    rnew, cnew = r, c + 1
                    if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                        direction = 'down'
                        rnew, cnew = r + 1, c
                        if not within_bounds(rnew, cnew) or room[rnew][cnew] == 1:
                            direction = 'left'
                            rnew, cnew = r, c - 1
                return 1 + solve(rnew, cnew, direction)
        rows = len(room)
        cols = len(room[0])
        visited = set()
        cleaned = set()
        solve(0, 0, 'right')
        return len(cleaned)

